import React from 'react';

function OrderHistory() {
  return (
    <div className="container py-5">
      <h2>Lịch sử đơn hàng</h2>
      <p>Trang lịch sử đơn hàng đang được phát triển.</p>
    </div>
  );
}

export default OrderHistory;
